import base64
import cv2
import numpy as np
import face_recognition

# Small face image (base64 JPEG of Obama)
# This is a tiny cropped face, enough for encoding
obama_base64 =""

# Decode base64  numpy array  image
img_data = base64.b64decode(obama_base64)
nparr = np.frombuffer(img_data, np.uint8)
image = cv2.imdecode(nparr, cv2.IMREAD_COLOR)

print(f"[INFO] Decoded embedded image: shape={image.shape}, dtype={image.dtype}")

# Convert BGR  RGB
rgb_img = cv2.cvtColor(image, cv2.COLOR_BGR2RGB)

try:
    face_locations = face_recognition.face_locations(rgb_img)
    print(f"[INFO] Found {len(face_locations)} face(s).")

    encodings = face_recognition.face_encodings(rgb_img, face_locations)
    print(f"[INFO] Got {len(encodings)} encodings.")

    if encodings:
        print(" Encoding vector length:", len(encodings[0]))
        print(" First 5 values of encoding:", encodings[0][:5])
except Exception as e:
    print(" face_recognition failed:", e)
